import React from "react";
import { Card, Col, Row } from "react-bootstrap";

const CartItems=(props)=>{

    return(
        <Card>
            <Card.Img src={props.url} style={{width: "5rem"}}/>
            <Card.Body>
                <Row xs={3}>
                   <Col>{props.title}</Col>
                   <Col>{props.price}</Col>
                   <Col>Quantity</Col>
                </Row>
            </Card.Body>
        </Card>
    )
}

export default CartItems
